/**
 * Collapsible Sidebar Component
 * Modern sidebar with toggle, dark theme, and mobile drawer
 */

import React, { useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import {
  House, UserCircle, ShieldCheck, Desktop, ClockClockwise,
  Files, NotePencil, Users, SignOut, List, X
} from 'phosphor-react';
import '../styles/Sidebar.css';

const Sidebar = ({ onLogout, user }) => {
  const [isCollapsed, setIsCollapsed] = useState(false);
  const [isMobileOpen, setIsMobileOpen] = useState(false);

  // Check if user has admin role
  const userRoles = user?.realmAccess?.roles || user?.realm_access?.roles || [];
  const isAdmin = userRoles.includes('admin') || userRoles.includes('realm-admin');

  const navItems = [
    { path: '/', icon: House, label: 'Dashboard' },
    { path: '/profile', icon: UserCircle, label: 'Profil Saya' },
    { path: '/security', icon: ShieldCheck, label: 'Keamanan' },
    { path: '/sessions', icon: Desktop, label: 'Sesi Aktif' },
    { path: '/logs', icon: ClockClockwise, label: 'Riwayat Login' },
    { path: '/documents', icon: Files, label: 'Dokumen' },
    { path: '/notes', icon: NotePencil, label: 'Catatan' },
  ];

  // Add User Management for admins only
  if (isAdmin) {
    navItems.push({ path: '/users', icon: Users, label: 'User Management' });
  }

  // Close mobile menu on route change
  useEffect(() => {
    setIsMobileOpen(false);
  }, [window.location.pathname]);

  // Toggle desktop sidebar collapse
  const toggleCollapse = () => {
    setIsCollapsed(!isCollapsed);
  };

  // Toggle mobile drawer
  const toggleMobile = () => {
    setIsMobileOpen(!isMobileOpen);
  };

  return (
    <>
      {/* Mobile Toggle Button - Visible only on mobile */}
      <button
        className="mobile-menu-toggle"
        onClick={toggleMobile}
        aria-label="Toggle menu"
      >
        <List size={24} weight="bold" />
      </button>

      {/* Mobile Overlay */}
      {isMobileOpen && (
        <div
          className="sidebar-overlay"
          onClick={() => setIsMobileOpen(false)}
        />
      )}

      {/* Sidebar */}
      <aside className={`sidebar ${isCollapsed ? 'collapsed' : ''} ${isMobileOpen ? 'mobile-open' : ''}`}>
        {/* Header */}
        <div className="sidebar-header">
          <div className="logo-box">
            <img
              src="https://jogjaprov.go.id/storage/files/shares/page/1518066730_2d84b769e3cc9d6f06f8c91a6c3e285c.jpg"
              alt="Logo DIY"
            />
          </div>
          {!isCollapsed && (
            <div className="brand-text">
              <h1>PEMDA DIY</h1>
              <p>Account Console</p>
            </div>
          )}

          {/* Mobile Close Button */}
          <button
            className="mobile-close-btn"
            onClick={toggleMobile}
            aria-label="Close menu"
          >
            <X size={24} weight="bold" />
          </button>
        </div>

        {/* Navigation */}
        <nav className="sidebar-nav">
          {navItems.map(({ path, icon: Icon, label }) => (
            <NavLink
              key={path}
              to={path}
              className={({ isActive }) => `nav-item ${isActive ? 'active' : ''}`}
              title={isCollapsed ? label : ''}
            >
              <Icon size={24} weight="regular" />
              {!isCollapsed && <span>{label}</span>}
            </NavLink>
          ))}
        </nav>

        {/* Footer */}
        <div className="sidebar-footer">
          {/* Desktop Toggle Button */}
          <button
            className="collapse-toggle desktop-only"
            onClick={toggleCollapse}
            title={isCollapsed ? 'Expand' : 'Collapse'}
          >
            <List size={20} weight="bold" />
            {!isCollapsed && <span>Collapse</span>}
          </button>

          {/* Logout Button */}
          <button className="logout-btn" onClick={onLogout}>
            <SignOut size={20} weight="regular" />
            {!isCollapsed && <span>Keluar</span>}
          </button>
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
